import torch

def complex_multiply_astar_b(a, b):

    tmp1 = torch.unsqueeze(a[..., 0] * b[..., 0] + a[..., 1] * b[..., 1], -1)
    tmp2 = torch.unsqueeze(a[..., 0] * b[..., 1] - a[..., 1] * b[..., 0], -1)

    return torch.cat([tmp1, tmp2], -1)

