def replace_at_index(string: str, new_char: str, index: int, no_fail: bool = False):

    n = len(string)
    if index not in range(n):
        if not no_fail:
            raise ValueError(f"Index out-of-bounds. Must be 0 < index â‰¤ {len(string)}.")
        else:
            return string

    max_index = n - 1

    new_string = string[:index] + new_char
    if index < max_index:
        new_string += string[index + 1:]

    return new_string

