def distribute_tasks(n, memlim):

    lims = []
    inflim = 0
    while True:
        if inflim + memlim >= n:
            lims.append([inflim, n])
            break
        else:
            lims.append([inflim, inflim+memlim])
            inflim = inflim+memlim
    return lims

