def partition_around_index(list_to_partition, index):

    list_len = len(list_to_partition)
    if list_len <= index:
        raise ValueError(
            "Index out of range: {} ({} item list)".format(index, list_len)
        )
    l1, l2 = [], []
    if index > 0:
        l1 = list_to_partition[0:index]
    if index < (list_len - 1):
        l2 = list_to_partition[(index + 1) :]
    return l1, l2

