def _compute_phi_ss(C, mag, c1_dists, log_phi_ss, mean_phi_ss):


    phi_ss = 0

    if mag < C['Mc1']:
        phi_ss = c1_dists

    elif mag >= C['Mc1'] and mag <= C['Mc2']:
        phi_ss = c1_dists + \
            (C['C2'] - c1_dists) * \
            ((mag - C['Mc1']) / (C['Mc2'] - C['Mc1']))
    elif mag > C['Mc2']:
        phi_ss = C['C2']

    return (phi_ss * 0.50 + mean_phi_ss * 0.50) / log_phi_ss

