def value_calc(stop, value=0.5):

    possible_stops = [0, 1, 2, 3]
    if not stop in possible_stops:
        return "error"
    if stop == 0:
        x = value / 3
        return value - 2 * x
    if stop == 1:
        x = value / 3
        return value - x
    if stop == 2:
        x = (1 - value) / 3
        return value + x
    if stop == 3:
        x = (1 - value) / 3
        return value + x * 2

